    public static class Clients
    {
        [FunctionName("clients")]
        public static async Task<HttpResponseMessage> Run([HttpTrigger(AuthorizationLevel.Function, "get", "post", Route = null)]HttpRequestMessage req, TraceWriter log)
        {
            log.Info("C# HTTP trigger function processed a request.");

            // parse query parameter
            string name = req.GetQueryNameValuePairs()
                .FirstOrDefault(q => string.Compare(q.Key, "name", true) == 0)
                .Value;

            if (name == null)
            {
                // Get request body
                dynamic data = await req.Content.ReadAsAsync<object>();
                name = data?.name;
            }

            List<Client> clientList = new List<Client>();
            Client client1 = new Client();
            client1.Id = 1;
            client1.Nombre = "juan Perez";
            client1.Nit = "898987987";
            clientList.Add(client1);

            Client client2 = new Client();
            client2.Id = 2;
            client2.Nombre = "Lucia Ajak";
            client2.Nit = "1231987987";
            clientList.Add(client2);

            Client client3 = new Client();
            client3.Id = 3;
            client3.Nombre = "Alan Tera";
            client3.Nit = "332123123";
            clientList.Add(client3);

            return req.CreateResponse(HttpStatusCode.OK, clientList);
        }

    }
